import React from "react";
import planty from "../../media/plant.png";

export default function ListOfPlants({
  plant,
  buttonLook,
  buttonClicks,
  couler,
}) {
  return (
    <div
      style={{ display: "flex", flexDirection: "column", alignItems: "center" }}
    >
      <img
        src={planty}
        alt="a plant"
        style={{
          width: "100px",
          backgroundColor: "#faf0e6",
          borderRadius: 10,
        }}
      />
      <h3>{plant.plantName}</h3>

       {buttonLook(plant.timestamp, plant.id)}
      <button
        // disabled
        style={{
          backgroundColor: "pink",
          borderRadius: 5,
          border: "none",
          outline: "none",
          fontWeight: "bold",
          color: "white",
          width: "100%",
          fontSize: "20px",
          height: "30px",
        }}
        onClick={() =>
          buttonClicks(plant.timestamp, plant.id, plant.plantStatus)
        }
      >
        Start Watering
      </button>
    </div>
  );
}
